					"value": "<p style=\"text-align:justify\">Des conférences sont régulièrement organisées autour des thématiques de l'agriculture urbaine et des pratiques de jardinage en ville. N'hésitez pas à vous rendre sur leur site pour vous renseigner...cccc</p>\r\n\r\n<p style=\"text-align:justify\">Pour pouvoir emprunter des outils, il suffit de signer la charte, puis de consulter le catalogue et enfin, d'aller retirer les outils sur place (https://docs.google.com/document/d/1JKiRrAnNbFh9yznXhT1CPPdnyW5THs2ipiEK73v5fNg/edit#)</p>\r\n",
