			"orga_initiative": "Association «  Atelier Citoyen pour la Transition Ecologique »",
			"objet_initiative": "<p style=\"text-align:justify\">L&#39;association l&#39;Atelier Citoyen pour la Transition Ecologique (ACTE) a pour objectif de faciliter les r&eacute;flexions et le passage &agrave; l&rsquo;action sur l&rsquo;&eacute;nergie et le d&eacute;veloppement durable dans les quartiers.</p>\r\n\r\n<p style=\"text-align:justify\">&Agrave; travers l&#39;exp&eacute;rimentation de divers dispositifs de partage des savoirs (citoyens, experts, chercheurs...) et de mobilisation locale, l&#39;association souhaite sensibiliser et accompagner les changements effectifs des comportements de chacun, selon le principe de la libre participation citoyenne.</p>\r\n",
			"lieu_initiative": "169 Rue du temple 75003 ",
			"adresse_initiative": "169 Rue du temple 75003 ",
			"lat_initiative": "48.8650259",
			"long_initiative": "2.359501",
			"custom_location": null,
			"id_quartier": "91",
			"arrond_initiative": "3",
			"horaires_initiative": "",
