			"tel_initiative": "",
			"website_initiative": "http://association-acte.org/energie/defi-familles-a-energie-positive/",
			"presa_image": "img/alternatives/AtelierCitoyenpourlaTransitionEcologique14_56_26.jpg",
			"credit_picto": "",
			"rs_initiative": "https://www.facebook.com/groups/acte75003/?fref=ts%20!",
			"info_initiative": "<p style=\"text-align:justify\">Voici des exemples d&#39;actions mises en place par l&#39;association ACTE:</p>\r\n\r\n<p style=\"text-align:justify\">- La premi&egrave;re exp&eacute;rimentation du D&eacute;fi Familles &agrave; Energie Positive sur Paris en 2011 : 20% d&rsquo;&eacute;conomie d&rsquo;&eacute;nergie dans son logement gr&acirc;ce &agrave; une centaine d&rsquo;&eacute;co-gestes;</p>\r\n\r\n<p style=\"text-align:justify\">- Un d&eacute;bat citoyen sur la transition &eacute;nerg&eacute;tique en 2013 : 60 habitants du 3<sup>&egrave;me</sup> ont formul&eacute; un avis collectif apr&egrave;s consultation d&rsquo;experts et d&eacute;bats, qui a ensuit&eacute; &eacute;t&eacute; transmis au Minist&egrave;re de l&#39;Environnement, de l&#39;&Eacute;nergie et de la Mer dans le cadre du d&eacute;bat national et de la pr&eacute;paration de la loi relative &agrave; la Transition &eacute;nerg&eacute;tique pour la croissance verte;</p>\r\n\r\n<p style=\"text-align:justify\">- &laquo; Manger sain et &agrave; prix doux dans le 3<sup>&egrave;me</sup> &raquo; : &eacute;tude et cartographie des sources d&rsquo;alimentation biologique ou en circuits-courts dans le 3&egrave;me arrondissement (AMAP, collectifs d&rsquo;achats libres, magasins bio, march&eacute;s alimentaires, jardins partag&eacute;s et autres alternatives);</p>\r\n\r\n<p style=\"text-align:justify\">- Mobilisation des habitants en vue de la conf&eacute;rence climat de D&eacute;cembre 2015 &agrave; Paris : analyse des informations scientifiques, r&eacute;alisation de plusieurs actions dans les rues de type &laquo; Porteurs de parole &raquo; avant de proposer un d&eacute;bat citoyen sous la forme d&rsquo;un Th&eacute;&acirc;tre-Forum pendant la COP21.</p>\r\n",
			"statut_initiative": "publiee",
			"admin_notes": "mail ref 04-07",
			"creation_date": "2015-11-30 13:20:23",
			"modification_date": "2016-07-04 12:55:07",
			"mail_user": "acte75003@gmail.com",
			"titre_typologie": "Energie et Transports",
			"picto_typologie": "img/typologies/energie.png",
			"nom_quartier": "Arts-et-Métiers",
			"objectID": "664",
