					"value": "<h1>BLU ?</h1>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#000000\">L&rsquo;association <em><strong>blu</strong></em> (loi 1901), créée à Paris,&nbsp;a&nbsp;pour but de promouvoir&nbsp;<strong><a href=\"http://www.theblueeconomy.org/Home.html\" style=\"color: #000000;\" target=\"_blank\" title=\"l’économie bleue\">l&rsquo;Economie Bleue</a></strong>, proposée par Gunter Pauli, en France.</span></p>\r\n\r\n<hr />\r\n<h3 style=\"text-align:justify\"><span style=\"color:#333399\">L&rsquo;Economie Bleue</span></h3>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#333399\">C'est la philosophie de<strong> <a href=\"http://www.zeri.org/\" style=\"color: #333399;\" target=\"_blank\">ZERI</a> </strong>en action. C&rsquo;est une économie qui, grâce à un modèle de production et consommation local qui agit avec ce qui est disponible localement, offre le meilleur pour la santé et l&rsquo;environnement de tous, de façon la plus abordable et ou les besoins de base de vie sont libres.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#333399\">Le concept de l&rsquo;Economie Bleue s&rsquo;appuie sur les principes du design systémique. Le systémique privilégie une approche globale, la multiplication des perspectives selon différentes dimensions ou à différents niveaux d&rsquo;organisation, et surtout la prise en compte des relations et interactions entre composants. Il permet de générer de nouveaux modèles économiques qui valorisent les ressources locales et créent de la richesse.</span></p>\r\n",
					"matchLevel": "none",
					"matchedWords": []
